import React from 'react'
import instalogo from '../Instagram-Logo.svg';
import fblogo from '../facebooklogo.png';


function Footer (){
    return (
        <footer class="bg-gray-300 text-center text-xs p-3 absolute bottom-0 w-full">
            <img src={instalogo} alt="Logo" />
            <img src={fblogo} alt="Logo" />
            &copy; Rice University CS Club 2020
        </footer>
    )
}

export default Footer
